// This function goes through the options for the given
// drop down box and removes them in preparation for
// a new set of values

function emptyList3( box ) {
	// Set each option to null thus removing it
	while ( box.options.length ) box.options[0] = null;
}

// This function assigns new drop down options to the given
// drop down box from the list of lists2 specified

function fillList3( box, arr ) {
	// arr[0] holds the display text
	// arr[1] are the values

	for ( i = 0; i < arr[0].length; i++ ) {

		// Create a new drop down option with the
		// display text and value from arr

		option = new Option( arr[0][i], arr[1][i] );

		// Add to the end of the existing options

		box.options[box.length] = option;
	}

	// Preselect option 0

	box.selectedIndex=0;
}

// This function performs a drop down list option change by first
// emptying the existing option list and then assigning a new set

function changeList3( box ) {
	// Isolate the appropriate list by using the value
	// of the currently selected option

	list = lists3[box.options[box.selectedIndex].value];

	// Next empty the slave list

	emptyList3( box.form.p_station);

	// Then assign the new list values

	fillList3( box.form.p_station, list );
}
